import React from "react";
import  ReactDOM  from "react-dom";
import logo from './logo.svg'

function Header() {
  return (
      <header>
          <nav>
              <img src="./logo.svg" width="40px" />
          </nav>
      </header>
  )
}
const element = 
<>
  <Header/>
</>

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(element);
